import React from 'react';
import './Cell.css';

class Cell extends React.Component {
    getColor(value) {
        const colors = [
            { name: "White", rgb: [255, 255, 255] },
            { name: "Snow", rgb: [255, 250, 250] },
            { name: "Light Pink", rgb: [255, 182, 193] },
            { name: "Pink", rgb: [255, 192, 203] },
            { name: "Light Salmon", rgb: [255, 160, 122] },
            { name: "Salmon", rgb: [250, 128, 114] },
            { name: "Indian Red", rgb: [205, 92, 92] },
            { name: "Firebrick", rgb: [178, 34, 34] },
            { name: "Brown", rgb: [165, 42, 42] }
          ];


        return colors[value].rgb;
    }

    render() {  
        const divStyle = {
            backgroundColor: this.getColor(this.props.number),
        };

        return (
            <div
                style={divStyle}
                className="cell"
            >
                {this.props.number}
            </div>
        );
    }
}

export default Cell;
